package com.au.chat;

// TODO: Auto-generated Javadoc
/**
 * The Class Like.
 */
public class Like {
	
	/** The name. */
	String name;

	/**
	 * Instantiates a new like.
	 */
	Like(){}
	
	/**
	 * Instantiates a new like.
	 *
	 * @param name the name
	 */
	public Like(String name) {
		super();
		this.name = name;
	}

	/**
	 * Gets the name.
	 *
	 * @return the name
	 */
	public String getName() {
		return name;
	}

	/**
	 * Sets the name.
	 *
	 * @param name the new name
	 */
	public void setName(String name) {
		this.name = name;
	}
	
}
